import React,{useState, useEffect} from "react";
import Title from "../Title";
import Icons from "../I-cons";
import Iconlist from "../IconList";


const icons = [
    { id: 1 , image:"public\images\salve-el-planeta.svg", title:"Estudios y proyectos ambientales" },
{id: 2 , image: "public\images\laboratorio.svg", title: " Servicios Topográficos y Aerofotogramétricos." },
{id: 3 , image: "public\images\la-contaminacion-del-agua.svg", title: "Operación y Mantenimiento de Plantas de Efluentes."},
{id: 4 , image: "public\images\laboratorio.svg", title: "Seguridad y Riesgo Industrial."},
{id: 5 , image: "public\images\aguas-residuales.svg", title:"Mediciones y Muestreos."},
{id: 6 , image: "public\images\sistema.svg", title: "Remediación Ambiental."}
];
function ItemListContainer({ texto }) {
    return(
        <>
       < Title greeting= {texto} />
     <Icons/> 
     <Iconlist/> 
        </>
        
    )
}
export default ItemListContainer;
